import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div className="app_wrapper">
      <header className="header">
        <img src="https://cdn3.iconfinder.com/data/icons/picons-social/57/56-apple-512.png"/>
      </header>

      <nav>
        <div>
          Profile
        </div>
        <div>
          Messeges
        </div>
      </nav>

      <div>
        Main content
      </div>
    </div>
  );
}

export default App;
